import React from 'react';
import logo from '../logos/MyMixer.png';
import './index.css';

const MixerLogo=() => {
    return (    
    <ul class="nav justify-content-left">
    <li class="nav-item">
      <a class="nav-link active" href="/">
        <img src={logo} alt="MixerLogo"/>
      </a>
    </li>
  </ul>
  )
}

export default MixerLogo
